    return (
      <div>
        <FullCalendar
            plugins={[dayGridPlugin, listPlugin]}
            initialView="dayGridMonth"
            locales={[jaLocale]}
            locale="ja"
            height={"100vh"}
            headerToolbar={
                { left: 'title', center: title, right: 'prev today next' }
            }
        />
      </div>
    );
  }

  export default calendar;
